import classes from "./Checkout.module.css";
import React, { useRef } from "react";
const Checkout = (props) => {
  const name = useRef();
  const street = useRef();
  const postalCode = useRef();
  const city = useRef();

  const confirmHandler = (event) => {
    event.preventDefault();
    const enterName = name.current.value;
    const enterStreet = street.current.value;
    const enterPostCode = postalCode.current.value;
    const enterCity = city.current.value;
  };

  return (
    <form className={classes.form} onSubmit={confirmHandler}>
      <div className={classes.control}>
        <label htmlFor="name">Your Name</label>
        <input type="text" id="name" ref={name} />
      </div>
      <div className={classes.control}>
        <label htmlFor="street">Street</label>
        <input type="text" id="street" ref={street} />
      </div>
      <div className={classes.control}>
        <label htmlFor="postal">Postal Code</label>
        <input type="text" id="postal" ref={postalCode} />
      </div>
      <div className={classes.control}>
        <label htmlFor="city">City</label>
        <input type="text" id="city" ref={city} />
      </div>
      <div className={classes.actions}>
        <button type="button" onClick={props.onCancel}>
          Cancel
        </button>
        <button className={classes.submit}>Confirm</button>
      </div>
    </form>
  );
};

export default Checkout;
